import {medSynthSound} from "./audio/medSynthSound.js";
formats.medSynthSound = medSynthSound.create(families.audio);
import {westwoodStudiosAudio} from "./audio/westwoodStudiosAudio.js";
formats.westwoodStudiosAudio = westwoodStudiosAudio.create(families.audio);
import {amSound} from "./audio/amSound.js";
formats.amSound = amSound.create(families.audio);
import {sonixInstrument} from "./audio/sonixInstrument.js";
formats.sonixInstrument = sonixInstrument.create(families.audio);
import {musiclineInstrument} from "./audio/musiclineInstrument.js";
formats.musiclineInstrument = musiclineInstrument.create(families.audio);
import {mp2} from "./audio/mp2.js";
formats.mp2 = mp2.create(families.audio);
import {soundBlasterInstrument} from "./audio/soundBlasterInstrument.js";
formats.soundBlasterInstrument = soundBlasterInstrument.create(families.audio);
import {aif} from "./audio/aif.js";
formats.aif = aif.create(families.audio);
import {covoxADPCM} from "./audio/covoxADPCM.js";
formats.covoxADPCM = covoxADPCM.create(families.audio);
import {musicStudioSound} from "./audio/musicStudioSound.js";
formats.musicStudioSound = musicStudioSound.create(families.audio);
import {stoneTrackerSample} from "./audio/stoneTrackerSample.js";
formats.stoneTrackerSample = stoneTrackerSample.create(families.audio);
import {flac} from "./audio/flac.js";
formats.flac = flac.create(families.audio);
import {maxonMagicSoundSample} from "./audio/maxonMagicSoundSample.js";
formats.maxonMagicSoundSample = maxonMagicSoundSample.create(families.audio);
import {amosSamples} from "./audio/amosSamples.js";
formats.amosSamples = amosSamples.create(families.audio);
import {creativeLabsInstrumentBank} from "./audio/creativeLabsInstrumentBank.js";
formats.creativeLabsInstrumentBank = creativeLabsInstrumentBank.create(families.audio);
import {au} from "./audio/au.js";
formats.au = au.create(families.audio);
import {avr} from "./audio/avr.js";
formats.avr = avr.create(families.audio);

// process our 'unsupported.js' formats
for(const [familyid, unsupportedFormats] of Object.entries(unsupported))
{
	for(const [formatid, o] of Object.entries(unsupportedFormats))
	{
		const supportedKeys = ["name", "ext", "magic", "weakMagic", "filename", "notes"];
		const extraKeys = Object.keys(o).subtractAll(supportedKeys);
		if(extraKeys.length>0)
			throw new Error(`unsupported format ${familyid}/${formatid} has extra keys that are not currently copied over to the Unknown class, add them: ${extraKeys}`);
		
		class Unsupported extends Format
		{
			unsupported = true;
		}

		formats[formatid] = Unsupported.create(families[familyid], format =>	// eslint-disable-line sembiance/shorter-arrow-funs
		{
			for(const supportedKey of supportedKeys)
			{
				if(Object.hasOwn(o, supportedKey))
					format[supportedKey] = o[supportedKey];
			}
		});
		formats[formatid].formatid = formatid;
	}
}
export {formats};
